import React, { Component } from "react";
import Draggable from "react-draggable";
import plant from "../Assets/plant.png";

export default class Plant extends Component {
  render() {
    return (
      <div>
        <Draggable>
          <img className="plant" src={plant} />
        </Draggable>
      </div>
    );
  }
}
